import React, { Component } from "react";
import style from "./Music.module.css";

export default class DoMore extends Component {
  render() {
    return (
      <div className={style.music}>
        <iframe
          src="https://open.spotify.com/embed/artist/0LIl9fjMPEZp8UDiL8Yuo4"
          width="300"
          height="380"
          frameborder="0"
          allowtransparency="true"
          allow="encrypted-media"
        ></iframe>
        <div id="div3">
		<ul>
			<li><a href="https://open.spotify.com/artist/0LIl9fjMPEZp8UDiL8Yuo4"> SPOTIFY</a></li>
						<li><a href="https://music.apple.com/us/artist/4b/684157880"> ï£¿ MUSIC </a></li>
		<li><a href="https://www.youtube.com/user/THEREALDJ4B/videos"> YOUTUBE </a></li>
			<li><a href="https://soundcloud.com/dj4b"> SOUNDCLOUD </a></li>
			</ul>

		</div>
      </div>
    );
  }
}
